import React from 'react';
import { Route, Routes } from 'react-router-dom';

import Nav from './components/nav.js';
import './App.css';

export default function App() {
  return (
    <Routes>
      <Route exact path='/henry'>
        <Nav/>
      </Route>
    </Routes>
  );
};
